import React from 'react';

import './menu-item.styles.scss';

const MenuItem = ({ title }) => (

    <div className='menu-item'>
        <h1 className='menu-title'>{title}</h1>
        <span className='action-call'>SHOP NOW</span>
    </div>

);

export default MenuItem;
